import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

// For the bits that make scrolling work as expected.
import { ScrollContext } from 'react-router-scroll-4';

// import './App.css';

// The pages components by the router
import Home    from './components/home'
import Details from './components/details'

class App extends Component {
  render() {
    return (
      <Router path={process.env.PUBLIC_URL + '/'}>
        <ScrollContext>
        <div className="App">
          <header className="App-header">
            <h1>Yo this is like the header or something...</h1>
            <Link to={'/'}>Search</Link>
            <Link to={'/about'}>About</Link>
            <Link to={'/naughty'}>Naughty</Link>
          </header>


           <Route path="/" exact component={Home} />
           <Route path="/details/:license/:prettyname" component={Details} />

        </div>
        </ScrollContext>
      </Router>
    );
  }
}

export default App;
